import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./Pythonimg/python1.jpg";
function Python() {
  return (
    <div>
      <Container>
        <Row className="row">
          <Col className="col1" lg={3}>
            <img src={img1} alt="" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Python;
